// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";

// Khai bo trc cu trc t ItemsManagement
contract ItemsManagement { // Tn hp ng, khng phi tn interface
    struct PhysicalLocationInfo { address locationId; string name; string locationType; address manager; bool exists; address designatedSourceWarehouseAddress; }
}

// Interface cho RoleManagement  kim tra vai tr Qun l Kho
interface IRoleManagement {
    function WAREHOUSE_MANAGER_ROLE() external view returns (bytes32);
    function hasRole(bytes32 role, address account) external view returns (bool);
}

// Interface cho ItemsManagement  ly thng tin kho (ty chn)
interface IItemsManagement {
    function getWarehouseInfo(address warehouseAddress) external view returns (ItemsManagement.PhysicalLocationInfo memory);
    // C th khng cn getItemInfo nu tin tng itemId t cc hp ng khc
}

// Interface cho StoreInventoryManagement  thng bo khi hng  c chuyn
interface IStoreInventoryManagement {
    function confirmStockReceivedFromWarehouse(
        address storeAddress,       // Ca hng nhn
        string calldata itemId,     // Mt hng
        uint256 quantity,           // S lng
        address fromWarehouseAddress, // Kho  gi (a ch ca hp ng ny)
        uint256 internalTransferId  // ID giao dch chuyn ni b
    ) external;
}

// Hp ng Qun l Tn kho Chnh (Kho trung tm)
contract WarehouseInventoryManagement is Ownable {
    IRoleManagement public roleManagementExternal;
    IItemsManagement public itemsManagementExternal; // Ty chn,  kim tra thm
    IStoreInventoryManagement public storeInventoryManagementExternal; // Hp ng Qun l Tn kho Ca hng
    
    address public warehouseSupplierOrderManagementAddress; //  nhn hng t NCC

    // Tn kho chnh: warehouseAddress => itemId => quantity
    mapping(address => mapping(string => uint256)) public stockLevels;

    // Hng tr v t khch hng ti kho
    mapping(address => mapping(string => uint256)) public returnedStockByCustomer;

    uint256 public nextInternalTransferId = 1; // ID cho vic chuyn hng ni b Kho -> Ca hng

    // S kin
        event StockInFromSupplierRecorded(
        address indexed warehouseAddress, // QUAN TRNG  lc theo kho
        string itemId,                    // itemId thng khng cn indexed nu bn lun c warehouseAddress
        uint256 quantityAdded,
        uint256 indexed wsOrderId,        // QUAN TRNG  lin kt vi n hng NCC
        address indexed byWsom            // QUAN TRNG  bit ai gi
    ); // 3 indexed: warehouseAddress, wsOrderId, byWsom

    event StockTransferredToStore(
        address indexed fromWarehouseAddress, // QUAN TRNG
        address indexed toStoreAddress,       // QUAN TRNG
        string itemId,
        uint256 quantity,
        uint256 indexed internalTransferId,   // QUAN TRNG  theo di
        address byWarehouseManager            // Ngi qun l kho thc hin, c th khng cn indexed nu bn c fromWarehouseAddress
    ); // 3 indexed: fromWarehouseAddress, toStoreAddress, internalTransferId

    event CustomerStockReturnedRecordedToWarehouse(
        address indexed returnToWarehouseAddress, // QUAN TRNG
        string itemId,
        uint256 quantityReturned,
        uint256 indexed customerOrderId         // QUAN TRNG
        // Khng cn thm indexed  y
    ); // 2 indexed: returnToWarehouseAddress, customerOrderId (OK)

    event StockAdjusted(
        address indexed warehouseAddress,        // QUAN TRNG
        string indexed itemId,                   // QUAN TRNG
        int256 quantityChange,
        string reason,
        address indexed byAdmin                  // QUAN TRNG
    ); // 3 indexed: warehouseAddress, itemId, byAdmin (OK)

    event ProcessedReturnedCustomerStockAtWarehouse(
        address indexed warehouseAddress,        // QUAN TRNG
        string indexed itemId,                   // QUAN TRNG
        uint256 quantityProcessed,
        bool addedToMainStock,
        address indexed byAdmin                  // QUAN TRNG
    );
    constructor(address _roleManagementAddress, address _itemsManagementAddress) Ownable() {
        require(_roleManagementAddress != address(0), "WIM: Dia chi RM khong hop le"); // WIM: a ch RM khng hp l
        roleManagementExternal = IRoleManagement(_roleManagementAddress);
        
        if (_itemsManagementAddress != address(0)) {
            itemsManagementExternal = IItemsManagement(_itemsManagementAddress);
        }
    }

    // Modifier ch cho php Qun l Kho ca kho c ch nh
    modifier onlyWarehouseManager(address _warehouseAddress) {
        // Kim tra _warehouseAddress c phi l kho hp l V msg.sender l qun l ca kho 
        ItemsManagement.PhysicalLocationInfo memory whInfo = itemsManagementExternal.getWarehouseInfo(_warehouseAddress);
        require(whInfo.exists, "WIM: Kho chua duoc dang ky trong ItemsM"); // WIM: Kho cha c ng k trong ItemsM
        require(whInfo.manager == msg.sender, "WIM: Nguoi goi khong phai quan ly kho nay"); // WIM: Ngi gi khng phi qun l kho ny
        bytes32 wmRole = roleManagementExternal.WAREHOUSE_MANAGER_ROLE();
        require(roleManagementExternal.hasRole(wmRole, msg.sender), "WIM: Nguoi goi thieu vai tro QUAN_LY_KHO"); // WIM: Ngi gi thiu vai tr QUAN_LY_KHO
        _;
    }

    // --- HM SETTER (Ch Owner) ---
    function setStoreInventoryManagementAddress(address _simAddress) external onlyOwner {
        require(_simAddress != address(0), "WIM: Dia chi SIM khong hop le"); // WIM: a ch SIM khng hp l
        storeInventoryManagementExternal = IStoreInventoryManagement(_simAddress);
    }

    function setWarehouseSupplierOrderManagementAddress(address _wsomAddress) external onlyOwner {
        require(_wsomAddress != address(0), "WIM: Dia chi WSOM khong hop le"); // WIM: a ch WSOM khng hp l
        warehouseSupplierOrderManagementAddress = _wsomAddress;
    }

    // --- CC HM CT LI ---

    // c gi bi WarehouseSupplierOrderManagement khi c hng mi t nh cung cp
    function recordStockInFromSupplier(
        address _warehouseAddress,      // Kho nhn hng
        string calldata _itemId,         // Mt hng
        uint256 _quantity,              // S lng
        uint256 _wsOrderId              // ID n hng Kho-NCC
    ) external {
        require(msg.sender == warehouseSupplierOrderManagementAddress, "WIM: Nguoi goi khong phai WSOM"); // WIM: Ngi gi khng phi WSOM
        require(_quantity > 0, "WIM: So luong them vao phai la so duong"); // WIM: S lng thm vo phi l s dng
        // Ty chn: Xc thc _warehouseAddress tn ti thng qua itemsManagementExternal

        stockLevels[_warehouseAddress][_itemId] += _quantity;
        emit StockInFromSupplierRecorded(_warehouseAddress, _itemId, _quantity, _wsOrderId, msg.sender);
    }

    // c gi bi StoreInventoryManagement (thay mt Qun l Ca hng)  yu cu hng
    // Logic ny gi nh StoreInventoryManagement  xc thc Qun l Ca hng v kho ngun ch nh.
    function requestStockTransferToStore(
        address _requestingStoreManager, // Ngi qun l ca hng yu cu (c SIM xc thc)
        address _storeAddress,          // Ca hng yu cu
        address _warehouseAddress,      // Kho ngun c ch nh cho ca hng
        string calldata _itemId,         // Mt hng
        uint256 _quantity               // S lng
    ) external returns (uint256 internalTransferId) {
        require(msg.sender == address(storeInventoryManagementExternal), "WIM: Nguoi goi khong phai SIM"); // WIM: Ngi gi khng phi SIM
        require(_quantity > 0, "WIM: So luong chuyen phai la so duong"); // WIM: S lng chuyn phi l s dng
        
        ItemsManagement.PhysicalLocationInfo memory whInfo = itemsManagementExternal.getWarehouseInfo(_warehouseAddress);
        require(whInfo.exists, "WIM: Kho nguon chua duoc dang ky"); // WIM: Kho ngun cha c ng k
        // Qun l thc t ca _warehouseAddress c th cn ph duyt.
        // Hin ti, gi nh nu SIM gi th c php nu c  hng.

        uint256 currentStock = stockLevels[_warehouseAddress][_itemId];
        require(currentStock >= _quantity, "WIM: Khong du hang trong kho"); // WIM: Khng  hng trong kho
        
        stockLevels[_warehouseAddress][_itemId] = currentStock - _quantity;
        internalTransferId = nextInternalTransferId++;

        // Thng bo cho StoreInventoryManagement  xc nhn  nhn hng
        storeInventoryManagementExternal.confirmStockReceivedFromWarehouse(
            _storeAddress,
            _itemId,
            _quantity,
            _warehouseAddress, // Bo co kho no  hon thnh
            internalTransferId
        );

        emit StockTransferredToStore(_warehouseAddress, _storeAddress, _itemId, _quantity, internalTransferId, _requestingStoreManager); // _requestingStoreManager l ngi khi to
        return internalTransferId;
    }
    
    // c gi bi CustomerOrderManagement khi khch hng tr hng v kho
    function recordReturnedStockByCustomer(
        address _returnToWarehouseAddress, // Kho c th c ch nh cho vic tr hng
        string calldata _itemId,
        uint256 _quantity,
        uint256 _customerOrderId
    ) external { // c gi bi COM
        // require(msg.sender == customerOrderManagementAddress, "WIM: Nguoi goi khong phai COM duoc uy quyen"); // Cn a ch COM
        require(_quantity > 0, "WIM: So luong tra ve phai la so duong"); // WIM: S lng tr v phi l s dng
        // Ty chn: Xc thc _returnToWarehouseAddress qua itemsManagementExternal

        returnedStockByCustomer[_returnToWarehouseAddress][_itemId] += _quantity;
        emit CustomerStockReturnedRecordedToWarehouse(_returnToWarehouseAddress, _itemId, _quantity, _customerOrderId);
    }

    // --- CC HM ADMIN (Ch Owner) ---
    function adjustStockManually(
        address _warehouseAddress,
        string calldata _itemId,
        int256 _quantityChange,      // C th m hoc dng
        string calldata _reason
    ) external onlyOwner { // Hoc onlyWarehouseManager(_warehouseAddress)
        uint256 currentStock = stockLevels[_warehouseAddress][_itemId];
        if (_quantityChange > 0) {
            stockLevels[_warehouseAddress][_itemId] = currentStock + uint256(_quantityChange);
        } else if (_quantityChange < 0) {
            uint256 amountToDecrease = uint256(-_quantityChange);
            require(currentStock >= amountToDecrease, "WIM: Dieu chinh thu cong dan den ton kho am"); // WIM: iu chnh th cng dn n tn kho m
            stockLevels[_warehouseAddress][_itemId] = currentStock - amountToDecrease;
        } else {
            revert("WIM: Thay doi so luong khong the bang khong"); // WIM: Thay i s lng khng th bng khng
        }
        emit StockAdjusted(_warehouseAddress, _itemId, _quantityChange, _reason, msg.sender);
    }

    function processCustomerReturnedStock(
        address _warehouseAddress,      // Kho cha hng tr v
        string calldata _itemId,
        uint256 _quantityToProcess,
        bool _addToMainStock          // V d: nu mt hng c th bn li
    ) external onlyOwner { // Hoc onlyWarehouseManager(_warehouseAddress)
        require(_quantityToProcess > 0, "WIM: So luong xu ly phai la so duong"); // WIM: S lng x l phi l s dng
        uint256 currentReturnedStock = returnedStockByCustomer[_warehouseAddress][_itemId];
        require(currentReturnedStock >= _quantityToProcess, "WIM: Khong du hang tra ve de xu ly"); // WIM: Khng  hng tr v  x l

        returnedStockByCustomer[_warehouseAddress][_itemId] = currentReturnedStock - _quantityToProcess;
        if (_addToMainStock) {
            stockLevels[_warehouseAddress][_itemId] += _quantityToProcess;
        }
        emit ProcessedReturnedCustomerStockAtWarehouse(_warehouseAddress, _itemId, _quantityToProcess, _addToMainStock, msg.sender);
    }

    // --- CC HM XEM (VIEW FUNCTIONS) ---
    function getWarehouseStockLevel(address _warehouseAddress, string calldata _itemId) external view returns (uint256) {
        return stockLevels[_warehouseAddress][_itemId];
    }

    function getCustomerReturnedStockLevelAtWarehouse(address _warehouseAddress, string calldata _itemId) external view returns (uint256) {
        return returnedStockByCustomer[_warehouseAddress][_itemId];
    }
}
